import { Form, Input, Checkbox, Button } from "antd"
import { LockOutlined, UserOutlined, InstagramOutlined, TwitterOutlined, FacebookFilled } from '@ant-design/icons';
import "./LoginRegister.scss"
import Footer from "../components/component-recycle/Footer";
import Header from "../components/component-recycle/Header";
import { Link } from "react-router-dom";


function LoginRegister() {
    const onFinishLogin = (values) => {
        console.log('Received values of form: ', values);
    };
    const onFinishRegister = (values) => {
        console.log('Received values of form: ', values);
    };
    return (
        <>
            <Header />

            <div className="centerLogin">
                <div className="login box">
                    <h1>Login</h1>
                    <p>Already have an account? Please, login!</p>
                    <Form
                        layout="vertical "
                        name="normal_login"
                        className="login-form"
                        initialValues={{
                            remember: true,
                        }}
                        onFinish={onFinishLogin}>
                        <Form.Item
                            name="email"
                            label="Email"
                            rules={[
                                {
                                    required: true,
                                    message: 'Please input your Email!',
                                },
                                { type: "email" }
                            ]}
                        >
                            <Input prefix={<UserOutlined className="site-form-item-icon" danger />} placeholder="Username" />
                        </Form.Item>
                        <Form.Item
                            label="Password"
                            name="password"
                            rules={[
                                {
                                    required: true,
                                    message: 'Please input your Password!',
                                },
                            ]}
                        >
                            <Input.Password
                                prefix={<LockOutlined className="site-form-item-icon" />}
                                type="password"
                                placeholder="Password"
                            />
                        </Form.Item>
                        <Form.Item>
                            <Button  type="primary" htmlType="submit" className="login-form-button">
                                Log in
                            </Button>
                        </Form.Item>
                        <Form.Item>
                            <Form.Item name="remember" valuePropName="checked" noStyle>
                                <Checkbox>Remember me</Checkbox>
                            </Form.Item>
                            <Link to="" className="login-form-forgot" >
                                Forgot password
                            </Link>
                        </Form.Item>
                    </Form>
                    <div className="login-other">
                        <p>Login with</p>
                        <div className="icon">
                            <InstagramOutlined />
                            <TwitterOutlined />
                            <FacebookFilled />
                        </div>
                    </div>
                </div>
                <div className="register box">
                    <h1>Register</h1>
                    <p>Don't have an account yet? Register here!</p>
                    <Form
                        name="normal_login"
                        className="login-form"
                        initialValues={{
                            remember: true,
                        }}
                        onFinish={onFinishRegister}>
                        <Form.Item
                            label="Email"
                            name="email"
                            rules={[
                                {
                                    required: true,
                                    message: 'Please input your Email!',
                                },
                                { type: "email" }
                            ]}
                        >
                            <Input prefix={<UserOutlined className="site-form-item-icon" danger />} placeholder="Username" />
                        </Form.Item>
                        <Form.Item
                            label="Passord"
                            name="password"
                            rules={[
                                {
                                    required: true,
                                    message: 'Please input your Password!',
                                },
                                {min:6}
                            ]}
                        >
                            <Input.Password
                                prefix={<LockOutlined className="site-form-item-icon" />}
                                type="password"
                                placeholder="Password"

                            />
                        </Form.Item>
                        <Form.Item
                            label="assord"
                            name="password"
                            rules={[
                                {
                                    required: true,
                                    message: 'Please input your Password!',
                                },
                                {min:6}
                            ]}
                        >
                            <Input.Password
                                prefix={<LockOutlined className="site-form-item-icon" />}
                                type="password"
                                placeholder="Password"

                            />
                        </Form.Item>
                        <Form.Item>

                            <Form.Item>
                                <Button type="primary" htmlType="submit" className="login-form-button">
                                    Register
                                </Button>
                            </Form.Item>
                        </Form.Item>
                    </Form>
                </div>
            </div>

            <Footer />
        </>);
}

export default LoginRegister;
